:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Henry Edward and CONNELL, Isabelle Annie
  JWILLIAMS, Henry Carleton and MILLS, Catherine Leslie
  JWILLIAMS, Terence Leslie Carleton and NOLAN, Mary Joyce
  JWILLIAMS, John Terence and MEYER, Helen Frances
  01> WILLIAMS, Nicholas Leslie
  b 16.08.1976
  Nicholas b. at Gisborne. He attended Hereworth School where he was a prefect and
  played in the 1st XV and the tennis team. He won the Gisborne Boys' High School
  Jubilee Scholarship in 1990, and played in the 2nd rugby XV. He completed a
  Commerce degree in Marketing at Otago University in 1997.
  02> WILLIAMS, Ben Meyer
  b 01.06.1978
  Ben b. at Gisborne. He attended Hereworth School where he was a prefect, captain
  of the 1st rugby XV and a member of the tennis team. He went on to Gisborne
  Boys' High School where he was captain of the 2nd rugby XV and he is now
  completing a Commerce degree at Canterbury University.
  03> WILLIAMS, Rosa Mary
  b 07.04.1981
  Rosa b, at Gisborne. She is a student at Woodford House,
  04> WILLIAMS, Christopher Henry m on 23.11.1985 to KIDDLE, Jillian Amelia
  b 06.11.1955
  b 17.08.1961
  Christopher b. at Gisborne and m. at Auckland. Jillian, d/o Warwick Kiddle and Anne Wakefield.
  Address: 316 Monument Road, Clevedon, RD 2, Papakura (PO Box 123).
  Chris was educated at Hereworth School, Christs College and Lincoln College (DipHortMgt). He
  travelled extensively before establishing his own landscape design and contracting firm in Auckland
  (1981-88). He returned to study and in 1990 graduated from the Royal Melbourne Institute of
  Technology with a Bachelor of Landscape Architecture. He then worked for three years for the
  Melbourne Metropolitan Board of Works (Melbourne Works) as an environmental designer in the Parks
  and Waterways Division. On returning to New Zealand, he worked in private practice and local
  government. He now has a landscape architecture consulting practice undertaking design, planning
  and management projects with a special interest in trees, urban design, integrated land use, parks
  development and garden restoration. He has been involved in a wide variety of projects including
  private residential developments, whole farm plantings, Ponsonby Road Streetscape Concept, Victoria
  Docks Open Space Development in Melbourne, Metropolitan Parks Management and Master Plans, Eastwood
  Hill Management Plan, Rainbows End Amusement Park, and others. He is a founder and board member of
  the Tree Council (Auckland).
  Jilly is a food stylist, artist and office manager.
  01> WILLIAMS, Ginger Hana
  b 29.04.1992
  Ginger b. at Melbourne, Australia. She attends Michael Park School in Ellerslie which is based
  on the Steiner philosophy of teaching.
